$.fn.customSelect = function (options) {
	var defaults = {};
	var settings = $.extend(defaults, options);

	const outer = $(this);
	const inner = outer.find("select");
	const otps = inner.find("option");
	const selectContentEl = $(`<div class="select-display">${inner.val()}</div>`);
	outer.append(selectContentEl);

	// add select item
	const items = [];
	const itemListEl = $(`<div class="select-item-list"></div>`);
	otps.each(function (index, el) {
		const div = $(`<div class="select-item">${el.value}</div>`);
		itemListEl.append(div);
		items.push(div);
	});
	outer.append(itemListEl);

	outer.on("click", function (e) {
		e.stopPropagation();
		$(this).toggleClass("opened");
	});

	items.forEach(function (item, index) {
		item.on("click", function (e) {
			e.stopPropagation();
			outer.toggleClass("opened");
			selectContentEl.html(item.html());
			inner.val(otps[index].value);
		});
	});

	function closeSelect(e) {
		outer.removeClass("opened");
	}

	window.addEventListener("click", closeSelect);
};


